import Panel from '../components/panel'

import styled from 'styled-components'
import '../styles/theme.css'

const Widgets = ({className}) => (
    <GridStyles className={className}>
      <PanelScore />
      <PanelThroughput />
      <PanelInit />
      <PanelUI />
      <PanelAssets />
      <PanelOpportunity />
      <PanelIssues />
    </GridStyles>
  );

const GridStyles = styled('div')`
  display: grid;
  grid-template-columns: repeat(6, auto);
  grid-template-rows: repeat(3, auto);
  gap: var(--space-unit);
`;

const PanelScore = styled(Panel)`
  grid-column: 1/4;
`;

const PanelThroughput = styled(Panel)`
  grid-column: 4/7;
`;

const PanelInit = styled(Panel)`
  grid-column: 1/3;
`;

const PanelUI = styled(Panel)`
  grid-column: 3/5;
`;

const PanelAssets = styled(Panel)`
  grid-column: 5/7;
`;

const PanelOpportunity = styled(Panel)`

`;

const PanelIssues = styled(Panel)`

`;

export default Widgets;
